USE `db_bioskop`;

/*Table structure for table `tb_booking` */

DROP TABLE IF EXISTS `tb_booking`;

CREATE TABLE `tb_booking` (
  `booking_id` char(10) NOT NULL,
  `user_id` char(10) NOT NULL,
  `schedule_id` char(10) NOT NULL,
  `tanggal_pemesanan` datetime DEFAULT current_timestamp(),
  `total_harga` int(11) NOT NULL,
  `status_pembayaran` enum('pending','paid','canceled') DEFAULT 'pending',
  PRIMARY KEY (`booking_id`),
  KEY `user_id` (`user_id`),
  KEY `schedule_id` (`schedule_id`),
  CONSTRAINT `tb_booking_ibfk_1` FOREIGN KEY (`user_id`) REFERENCES `tb_user` (`user_id`) ON DELETE CASCADE,
  CONSTRAINT `tb_booking_ibfk_2` FOREIGN KEY (`schedule_id`) REFERENCES `tb_schedule` (`schedule_id`) ON DELETE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

/*Data for the table `tb_booking` */

/*Table structure for table `tb_booking_detail` */

DROP TABLE IF EXISTS `tb_booking_detail`;

CREATE TABLE `tb_booking_detail` (
  `booking_detail_id` char(10) NOT NULL,
  `booking_id` char(10) NOT NULL,
  `seat_id` char(10) NOT NULL,
  PRIMARY KEY (`booking_detail_id`),
  KEY `booking_id` (`booking_id`),
  KEY `seat_id` (`seat_id`),
  CONSTRAINT `tb_booking_detail_ibfk_1` FOREIGN KEY (`booking_id`) REFERENCES `tb_booking` (`booking_id`) ON DELETE CASCADE,
  CONSTRAINT `tb_booking_detail_ibfk_2` FOREIGN KEY (`seat_id`) REFERENCES `tb_seat` (`seat_id`) ON DELETE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

/*Data for the table `tb_booking_detail` */

/*Table structure for table `tb_movie` */

DROP TABLE IF EXISTS `tb_movie`;

CREATE TABLE `tb_movie` (
  `movie_id` char(10) NOT NULL,
  `poster` mediumblob NOT NULL,
  `judul` varchar(255) NOT NULL,
  `genre` varchar(25) NOT NULL,
  `durasi` int(11) NOT NULL,
  `rating` decimal(3,1) NOT NULL,
  `sinopsis` varchar(255) NOT NULL,
  `trailer_url` text DEFAULT NULL,
  `tanggal_tambah` datetime DEFAULT current_timestamp(),
  PRIMARY KEY (`movie_id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

