('scd001','mov002','std002','2025-10-27','12:44:00',30000);

/*Table structure for table `tb_seat` */

DROP TABLE IF EXISTS `tb_seat`;

CREATE TABLE `tb_seat` (
  `seat_id` char(10) NOT NULL,
